Nick Di Paolo (born January 31, 1962 in Danvers, Massachusetts) is an Italian-American stand-up comedian, writer and radio host formerly on 92.3 Free FM in New York City until May 24, 2007, when the station changed formats. His comic style is unapologetically brazen, including a lot of &quot;politically incorrect&quot; humor, and was featured in May 6, 2007 article in The New York Times. Di Paolo's stand-up has been featured on Comedy Central Presents and he has appeared on other Comedy Central shows including Tough Crowd with Colin Quinn, The Comedy Central Roast of Pamela Anderson, The Comedy Central Roast of Denis Leary, The Comedy Central Roast of Jeff Foxworthy, The Comedy Central Roast of Larry the Cable Guy and the animated series Shorties Watchin' Shorties, in which he voices the character &quot;Baby Nick&quot;. He has appeared as a police officer in Artie Lange's movie Beer League, in The Sopranos, and in numerous sketches on The Chris Rock Show, where he was also a writer and nominated for two Emmy Awards. He was cast as the building super on Louis CK's short lived HBO show Lucky Louie. He also is a regular commentator on The Smoking Gun Presents: World's Dumbest

Di Paolo is also a frequent guest on the Opie and Anthony radio show and Howard Stern.

In 2008 Di Paolo visited soldiers serving in Afghanistan as part of a six person USO/ Armed Forces Operation Mirth Comedy Tour.
